# Creating a dictionary with the counts of each base
basenrs = {
    "A": 0,
    "C": 0,
    "G": 0,
    "T": 0
}

# Our input sequence
sequence = ""

# For each base in the sequence, add one to the value of
# the corresponding dictionary key.
for i in range(len(sequence)):
    basenrs[sequence[i]] += 1

# Print result
print(basenrs)